   const day=props.data.toLocaleString("en-US" ,{day:'2-digit'});
   const year=props.data.getFullYear();
  return(
    <div className="expnse-item__data">
      <div>{menth}</div>
      <div>{day}</div>
      <div>{year}</div>
    </div>
  );
}
  export default ExpendelitemData;
